import React from 'react';

export default function Celebrity( props ) {
    return (
        <div class="celebrity">
            <div class="text">
                <h2>{props.name}</h2>
                <div class="earnings">
                    <h3>Earnings:</h3>{props.earnings}
                </div>
                <div class="age">
                    <h3>Age:</h3>{props.age}
                </div>
                <div class="citizenship">
                    <h3>Citizenship:</h3>{props.citizenship}
                </div>
                <div class="events">
                    <ul>
                        <li>{props.events}</li>
                    </ul>
                </div>
            </div>
        </div>
    );
}
